// Plugin to get the viewport of element
var timeout;
$(window).on("load scroll resize", function() {
  if (timeout) {
    clearTimeout(timeout);
  }
  timeout = setTimeout(function() {
    var $window = $(window),
      hitbox_top = $window.scrollTop() + $window.height() * .1,
      hitbox_bottom = $window.scrollTop() + $window.height() * .7;
    $(".anim, .target").each(function() {
      var $element = $(this),
        element_top = $element.offset().top,
        element_bottom = $element.offset().top + $element.height();
        if(hitbox_bottom > element_top){
          $element.addClass("active");
        };
    });
  });
});


